INSERT INTO `llx_c_taxexemption` VALUES ('M00','IVA - Regime Simplificado','Lei n.º 42/20','Foi utilizado até 31-12-2020 como IVA - Regime transitório',1,1),('M02','Transmissão de bens e serviços não sujeita',NULL,NULL,2,1),('M04','IVA - Regime de Exclusão','Lei n.º 42/20','Foi utilizado até 31-12-2020 como IVA - Regime de não sujeição',3,1),('M10','Isento nos termos da alínea a) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','A transmissão dos bens alimentares, conforme anexo I do presente código.',4,1),('M11','Isento nos termos da alínea b) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','As transmissões de medicamentos destinados exclusivamente a fins terapêuticos e profilácticos.',5,1),('M12','Isento nos termos da alínea c) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','As transmissões de cadeiras de rodas e veículos semelhantes, accionados manualmente ou por motor, para portadores de deficiência, aparelhos, máquinas de escrever com caracteres braille, impressoras para caracteres braille e os artefactos que se destinam a ser utilizados por invisuais ou a corrigir a audição',6,1),('M13','Isento nos termos da alínea d) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','A transmissão de livros, incluindo em formato digital',7,1),('M14','Isento nos termos da alínea e) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','A locação de bens imóveis destinados a fins habitacionais, designadamente prédios urbanos, fracções autónomas destes ou terrenos para construção, com excepção das prestações de serviços de alojamento efectuadas no âmbito da actividade hoteleira ou de outras com funções análogas',8,1),('M15','Isento nos termos da alínea f) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','As operações sujeitas ao imposto de SISA, ainda que dele isentas',9,1),('M16','Isento nos termos da alínea g) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','A exploração e a prática de jogos de fortuna ou azar e de diversão social, bem como as respectivas comissões e todas as operações relacionadas, quando as mesmas estejam sujeitas a Imposto Especial sobre o Jogos, nos termos da legislação aplicável',10,1),('M17','Isento nos termos da alínea h) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','O transporte colectivo de passageiros',11,1),('M18','Isento nos termos da alínea i) do nº1 artigo 12.º do CIVA','Artigo 12.º do CIVA','As operações de intermediação financeira, incluindo a locação financeira, exceptuando-se aquelas em que uma taxa, ou contraprestação, especifica e predeterminada é cobrada pelo serviço.',12,1),('M19','Isento nos termos da alínea j) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','O seguro de saúde, bem como a prestação de seguros e resseguros do ramo vida;',13,1),('M20','Isento nos termos da alínea k) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','As transmissões de produtos petrolíferos conforme anexo II do presente código.',14,1),('M21','Isento nos termos da alínea l) do nº1 do artigo 12.º do CIVA','Artigo 12.º do CIVA','As prestações de serviço que tenham por objecto o ensino, efectuadas por estabelecimentos integrados conforme definidos na Lei de Bases do Sistema de Educação e Ensino, bem como por estabelecimentos de Ensino Superior devidamente reconhecidos pelo Ministério de Tutela.',15,1),('M22','Isento nos termos da alínea m) do artigo 12.º do CIVA','Artigo 12.º do CIVA','As prestações de serviço médico sanitário, efectuadas por estabelecimentos hospitalares, clinicas, dispensários e similares',16,1),('M23','Isento nos termos da alínea n) do artigo 12.º do CIVA','Artigo 12.º do CIVA','O transporte de doentes ou feridos em ambulâncias ou outros veículos apropriados efectuados por organismos devidamente autorizados',17,1),('M24','Isento nos termos da alínea o) do artigo 12.º do CIVA','Artigo 12.º do CIVA','Os equipamentos médicos para o exercício da actividade dos estabelecimentos de saúde.',18,1),('M30','Isento nos termos da alínea a) do artigo 15.º do CIVA','Artigo 15.º do CIVA','As transmissões de bens expedidos ou transportados com destino ao estrangeiro pelo vendedor ou por um terceiro por conta deste',19,1),('M31','Isento nos termos da alínea b) do artigo 15.º do CIVA','Artigo 15.º do CIVA','As transmissões de bens de abastecimento postos a bordo das embarcações que efectuem navegação marítima em alto mar e que assegurem o transporte remunerado de passageiros ou o exercício de uma actividade comercial, industrial ou de pesca;',20,1),('M32','Isento nos termos da alínea c) do artigo 15.º do CIVA','Artigo 15.º do CIVA','As transmissões de bens de abastecimento postos a bordo das aeronaves utilizadas por companhias de navegação aérea que se dediquem principalmente ao tráfego internacional e que assegurem o transporte remunerado de passageiros, ou o exercício de uma actividade comercial ou industrial',21,1),('M33','Isento nos termos da alínea d) do artigo 15.º do CIVA','Artigo 15.º do CIVA','As transmissões de bens de abastecimento postos a bordo das embarcações de salvamento, assistência marítima, pesca costeira e embarcações de guerra, quando deixem o país com destino a um porto ou ancoradouro situado no estrangeiro',22,1),('M34','Isento nos termos da alínea e) do artigo 15.º do CIVA','Artigo 15.º do CIVA','As transmissões, transformações, reparações, manutenção, frete e aluguer, incluindo a locação financeira, de embarcações e aeronaves afectas às companhias de navegação aérea e marítima que se dediquem principalmente ao tráfego internacional, assim como as transmissões de bens de abastecimento postos a bordo das mesmas e as prestações de serviços efectuadas com vista à satisfação das suas necessidades directas e da respectiva carga;',23,1),('M35','Isento nos termos da alínea f) do artigo 15.º do CIVA','Artigo 15.º do CIVA','As transmissões de bens efectuadas no âmbito de relações diplomáticas e consulares cuja isenção resulte de acordos e convénios internacionais celebrados por Angola;',24,1),('M36','Isento nos termos da alínea g) do artigo 15.º do CIVA','Artigo 15.º do CIVA','As transmissões de bens destinados a organismos internacionais reconhecidos por Angola ou a membros dos mesmos organismos, nos limites e com as condições fixadas em acordos e convénios internacionais celebrados por Angola',25,1),('M37','Isento nos termos da alínea h) do artigo 15.º do CIVA','Artigo 15.º do CIVA','As transmissões de bens efectuadas no âmbito de tratados e acordos internacionais de que a República de Angola seja parte, quando a isenção resulte desses mesmos tratados e acordos',26,1),('M38','Isento nos termos da alínea i) do artigo 15.º do CIVA','Artigo 15.º do CIVA','O transporte de pessoas provenientes ou com destino ao estrangeiro.',27,1),('M80','Isento nos termos da alinea a) do nº1 do artigo 14.º','Artigo 14.º do CIVA','As importações definitivas de bens cuja transmissão no território nacional seja isenta de imposto;',28,1),('M81','Isento nos termos da alinea b) do nº1 do artigo 14.º','Artigo 14.º do CIVA','As importações de ouro, moedas ou notas de banco, efectuadas pelo Banco Nacional de Angola',29,1),('M82','Isento nos termos da alinea c) do nº1 do artigo 14.º','Artigo 14.º do CIVA','A importação de bens destinados a ofertas para atenuar os efeitos das calamidades naturais, tais como cheias, tempestades, secas, ciclones, sismos, terramotos e outros de idêntica natureza, desde que devidamente autorizado pelo Titular do Poder Executivo',30,1),('M83','Isento nos termos da alinea d) do nº1 do artigo 14.º','Artigo 14.º do CIVA','A importação de mercadorias ou equipamentos destinadas exclusiva e directamente à execução das operações petrolíferas e mineiras nos termos da Lei que estabelece o Regime Aduaneiro do Sector Petrolífero e do Código Mineiro, respectivamente.',31,1),('M84','Isento nos termos da alínea e) do nº1 do artigo 14.º','Artigo 14.º do CIVA','Importação de moeda estrangeira efectuada pelas instituições financeiras bancárias, nos termos definidos pelo Banco Nacional de Angola.',32,1),('M85','Isento nos termos da alinea a) do nº2 do artigo 14.º','Artigo 14.º do CIVA','No âmbito de tratados e acordos internacionais de que a República de Angola seja parte, nos termos previstos nesses tratados e acordos;',33,1),('M86','Isento nos termos da alinea b) do nº2 do artigo 14.º','Artigo 14.º do CIVA','No âmbito de relações diplomáticas e consulares, quando a isenção resulte de tratados e acordos internacionais celebrados pela República de Angola',34,1),('M90','Isento nos termos da alinea a) do nº1 do artigo 16.º','Artigo 16º do CIVA','As importações de bens que, sob controlo aduaneiro e de acordo com as disposições aduaneiras especificamente aplicáveis, sejam postas nos regimes de zona franca, que sejam introduzidos em armazéns de regimes aduaneiros ou lojas francas, enquanto permanecerem sob tais regimes;',35,1),('M91','Isento nos termos da alinea b) do nº1 do artigo 16.º','Artigo 16º do CIVA','As transmissões de bens que sejam expedidos ou transportados para as zonas ou depósitos mencionados na alínea anterior, bem como as prestações de serviços directamente conexas com tais transmissões;',36,1),('M92','Isento nos termos da alinea c) do nº1 do artigo 16.º','Artigo 16º do CIVA','As transmissões de bens que se efectuem nos regimes a que se refere a alínea a), assim como as prestações de serviços directamente conexas com tais transmissões, enquanto os bens permanecerem naquelas situações',37,1),('M93','Isento nos termos da alinea d) do nº1 do artigo 16.º','Artigo 16º do CIVA','As transmissões de bens que se encontrem nos regimes de trânsito, draubaque ou importação temporária e as prestações de serviços directamente conexas com tais operações, enquanto os mesmos forem considerados abrangidos por aqueles regimes',38,1),('M94','Isento nos termos da alinea e) do nº1 do artigo 16.º','Artigo 16º do CIVA','A reimportação de bens por quem os exportou, no mesmo estado em que foram exportados, quando beneficiem de isenção de direitos aduaneiros',39,1);
